using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// The NSExtensionRequestHandling protocol provides a life cycle hook into an app extension. An extension’s principal object can implement this protocol and use beginRequestWithExtensionContext: to keep track of the request from a host app.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Foundation/Reference/NSExtensionRequestHandling_Protocol/index.html#//apple_ref/occ/intf/NSExtensionRequestHandling"/>    [iOSVersion(8)]    public interface NSExtensionRequestHandling//: NSObjectProtocol    {        /// <summary>        /// Tells the extension to prepare for a host app’s request. (required)        /// </summary>        /// <param name="context">An NSExtensionContext object that represents the context in which the host app makes the request. Typically, the context contains data that the extension can work on.</param>        [iOSVersion(8)]        [Export("beginRequestWithExtensionContext")]        void BeginRequestWithExtensionContext(NSExtensionContext context);    }}